import React, {Component} from 'react';
import { Link, withRouter } from 'react-router-dom';
import Recipe from '../component/Recipe';

class Receta extends Component{

	render(){
		return(
			<section>
			<h1>Lista de recetas</h1>
				{
					this.props.recetas.length === 0 ? <h4 className="alert alert-warning">No hay recetas guardadas</h4> : 
					this.props.recetas.map((recipe) => {
						return(
							<Recipe key={recipe.id}
							delete={this.props.delete}
							{...recipe}
							/>
						);
					})
				}
				<br/>
				<Link to="/agregar" className='btn btn-primary'>Agregar nueva receta</Link>
			</section>
		);
	}
}

export default withRouter(Receta);
